import React from 'react'
import BillingTransactionLoop from './BillingTransactionLoop';

export default function BillingInvoiceSection(props) {

    const test = props.userTransaction;

    const TransactionsInvoiceloop = test.map((transaction, index) =>
        <li key={index} className='billing-transaction-item'>
            <div className='billing-transaction-details'>
                <div className='details'>
                    <p> {transaction.transactionName} </p>
                    <span>  {transaction.transactionTime} </span>
                </div>
            </div>
            <div className='billing-transaction-amount'>
                <p className={(transaction.transactionStatus)}> $ {transaction.transactionAmount} </p>
            </div>
        </li>
    );

    return (
        <>
            <div className='Billing-invoice-wrapper'>
                <p className='billing-heading-title'> Invoices </p>
            </div>

            <ul className='Billing-invoice-items-wrapper'>
                {TransactionsInvoiceloop}
            </ul>
        </>
    )
}
